import React from "react";
import styles from "./SearchBox.module.css"

const SearchBox = ({searchBox,apple,xiaomi}) => {

    let AppleElementSearch = apple.filter(f => f.name.toLowerCase().includes(searchBox)).map(ae => <div
        key={ae.id} {...ae}>{ae.name}</div>)


    let XiaomiElementSearch = xiaomi.filter(f => f.name.toLowerCase().includes(searchBox)).map(ae => <div
        key={ae.id} {...ae}>{ae.name}</div>)

    return <div className={styles.searchBox}>
        {AppleElementSearch}
        {XiaomiElementSearch}
    </div>

}

export default SearchBox;
